DROP TABLE IF EXISTS vote;

CREATE TABLE `vote` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `entry` int(11) NOT NULL,
  `ip` varchar(15) NOT NULL,
  `email` varchar(255) NOT NULL,
  `verifystring` varchar(40) NOT NULL,
  `date` datetime NOT NULL,
  `verified` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `entry` (`entry`)
) ENGINE=InnoDB AUTO_INCREMENT=1474 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS wame_core_logins;

CREATE TABLE `wame_core_logins` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ip` varchar(50) NOT NULL,
  `failed_login_attempts` int(11) NOT NULL,
  `last_failed_login_attempt` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS wame_core_passwordtoken;

CREATE TABLE `wame_core_passwordtoken` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `hash` varchar(63) NOT NULL,
  `expire` datetime NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS wame_core_role;

CREATE TABLE `wame_core_role` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `role` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS wame_core_roleright;

CREATE TABLE `wame_core_roleright` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `role` int(11) NOT NULL,
  `system` varchar(255) NOT NULL,
  `controller` varchar(255) NOT NULL,
  `action` varchar(255) NOT NULL,
  `rights` tinyint(3) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `role` (`role`),
  CONSTRAINT `wame_core_roleright_ibfk_1` FOREIGN KEY (`role`) REFERENCES `wame_core_role` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=111 DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS wame_core_user;

CREATE TABLE `wame_core_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(255) NOT NULL,
  `password` varchar(63) NOT NULL,
  `deleted` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS wame_core_userdata;

CREATE TABLE `wame_core_userdata` (
  `id` int(11) NOT NULL COMMENT 'zelfde aan wame_core_user.id',
  `voornaam` varchar(255) NOT NULL,
  `tussenvoegsel` varchar(255) DEFAULT NULL,
  `achternaam` varchar(255) NOT NULL,
  PRIMARY KEY (`id`),
  CONSTRAINT `wame_core_userdata_ibfk_1` FOREIGN KEY (`id`) REFERENCES `wame_core_user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS wame_core_userrole;

CREATE TABLE `wame_core_userrole` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user` int(11) NOT NULL,
  `role` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `user` (`user`),
  KEY `role` (`role`),
  CONSTRAINT `wame_core_userrole_ibfk_3` FOREIGN KEY (`user`) REFERENCES `wame_core_user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `wame_core_userrole_ibfk_4` FOREIGN KEY (`role`) REFERENCES `wame_core_role` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;




