INSERT INTO entry VALUES("268","1","php6EfMG4_1396548784620.jpg","Marcia","van der Steen - de Vos","Deze keuken is 14 Jaar oud! Vorig jaar stopte de vaatwasser er al mee! We hebben gewoon de financiële middelen op dit moment niet  om hem op te knappen. INSERT INTO entry VALUES("269","1","phpCCsZ5R_1396641510083.jpg","Hanneke","Jacobs","deze keuken is al zo oud en lelijk.we hebben hem geschilderd toen we hier kwamen wonen.het blad is zo lelijk.kookplaat op het blad zo lelijk.de lades zo onpraktisch met jonge kids.word dus echt tijd voor een metamorfose","hannekejacobs33@hotmail.com","81.205.101.61","0","Trompstraat 38 ","","6651 ZP","Druten","2014-04-04 20:02:05","","1","0");
INSERT INTO entry VALUES("270","1","phpNjSZ60_image.jpg","Mitchell","de Bruine","Ik heb net mijn eerste appartementje gekocht in Den Bosch en om het helemaal perfect te maken, zou ik mijn keuken willen renoveren. Ik hoop dat jullie mij hierbij kunnen helpen.","Nigel_de_bruine@hotmail.com","87.209.66.116","0","","0619442775","","Den Bosch","2014-04-06 12:20:38","rNSTAwcUIV","1","0");
INSERT INTO entry VALUES("271","1","php3JE6C1_image.jpg","Judith","Van der Bent","De fineer van de kastjes begint los te laten helaas.","Barryjudith@telfort.nl","77.172.43.127","0","","0646588816","","Katwijk","2014-04-09 07:14:21","HsNDOeVC6h","1","0");
INSERT INTO entry VALUES("272","1","phpvT0LW3_unnamed.jpg","Eve","Allijn","De keuken is heel oud en heeft een lelijke lavendelachtige kleur. Van een afstandje valt het nog wel mee, maar van dichtbij zie je dat er veel kapot is. Mijn vriend en ik zijn net gaan samenwonen en het lijkt me geweldig als ik dit als verrassing aan hem kan geven!","eveallijn@gmail.com","95.96.99.127","1","","0614777429","","KOOG AAN DE ZAAN","2014-04-09 08:24:07","4KoiT2EyYv","1","0");
INSERT INTO entry VALUES("273","1","phpCknVB8_1397330606313.jpg","marjan","hahn","het is een oud model en ik ben verliefd op een rode keuken,dat lijkt mij echt heel gaafINSERT INTO entry VALUES("274","1","phprL2Jew_image.jpg","Deciree","De heer ","Deze keuken is al 15 jaar oud. Er zijn vele mogelijkheden, kleuren, fromtem, te veel om op te noemen. En hetgene wat wij het allermooiste vinden past niet binnen ons budget. We zijn. U al 2 jaar bezig, maar er is nog niets aan de keuken gedaan. Wordt nu echt wel tijd! Rust in je huis is rust in je hoofd. Ik hou van koken, maar in deze keuken raak ik niet geïnspireerd om er veel mee te doen. ","D.de.heer@hotmail.com","195.240.195.16","0","","06-39439979","","Epe","2014-04-14 11:58:48","U1lPeb92Bi","1","0");
INSERT INTO entry VALUES("275","1","phpwuHAZf_IMG_0820.JPG","Jacoby","de Graaf","Wij hebben dit huis gekocht en dit is totaal onze smaak niet!Wij willen dolgraag een nieuwe keuken!","jacobydegraaf@kliksafe.nl","213.247.64.29","1","","0652280381","","Oud-Beijerland","2014-04-15 06:10:09","5B70TCMoeQ","1","0");
INSERT INTO entry VALUES("276","1","phpS212Lp_1397575423059.jpg","medine","meral","Mijn kastjes zijn in een heel slecht staat, de inbouwapparatuur die doen het niet goed. Mijn keuken is gewoon de lelijkste en saaiste keuken ooit!!","al_gul81@hotmail.com","81.68.112.42","0","","31653637376","","rotterdam","2014-04-15 15:29:49","oBCsVJpnUl","1","0");
INSERT INTO entry VALUES("277","1","phplYgA2g_DSC_1036.jpg","halime","murat","Wy hebben dit huisje gekocht, alleen niks aan de keukeb kunnen doen.. Ben gek op kleurtjes, dus zou graag een felle kleur in mijn keuken willen!","halime__murat@hotmail.com","92.109.227.2","0","","0641957875","","Rotterdam","2014-04-15 19:33:19","qmwVIvL86D","1","0");
INSERT INTO entry VALUES("278","1","phpztICV6_image.jpg","Angela","Silvius ","Het keukenblad is beschadigd en zo ook enkele deurtjes. Liever een groter gasstel. Kortom hij wordt oud.","asildra@kpnplanet.nl","86.87.72.149","0","","0614028379","","Scharnegoutum","2014-04-17 08:53:46","AqSOp8lrWd","1","0");
INSERT INTO entry VALUES("279","1","phpNN13s7_DSC_0193.JPG","Lindsey","Hamawi","In augustus 2013 zijn we getrouwd. We wonen nu 3 jaar in dit heerlijke huis en hebben de kans om dit huis te kopen. Maar de keuken in dit huis is een standaard keuken. Als we dit huis kopen hoort daar natuurlijk een prachtige keuken in. Na een heftig jaar zou ik mijn man deze droom graag willen geven. Hij houd van koken en is er ook nog eens erg goed in!!","Maantje20@hotmail.com","217.122.88.244","0","","0624313470","","Rijsenhout","2014-04-21 18:36:18","VlibPKScU5","1","0");
